import React from "react";

const Main = () => {
  return (
    <div className="main">
      <div className="imagen">
        <img src="#" alt="#" />
      </div>

      <div className="titulo">
        <h2 className="text-start">Who I am?</h2>
      </div>
      <div className="parrafo">
        <h3 className="text-center">
          I am a Product Design Engineer (graduated from EAFIT University) and
          front-end developer, with more than three years of experience in areas
          of engineering, projects, design and web development. Currently I work
          as a freelance programmer. <br /> <br />
          On a personal level I recognize strengths to learn on my own, work as
          a team, be focused, perseverant and passionate about constant
          learning.
        </h3>
      </div>
    </div>
  );
};

export default Main;
